INSERT INTO `our_service` (`id`, `category_id`, `title`, `image`, `short_description`, `description`, `status`) VALUES
(1, 5, 'Commercial Cleaning', '1648023011-42353072.jpg', 'Your office building is the face of your company. That’s why, using the latest technologies', '<div class=\"row\" style=\"box-sizing: border-box; margin-left: -15px; margin-right: -15px; color: #444444; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">\r\n<div class=\"col-md-12 col-sm-12 col-xs-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-left: 15px; padding-right: 15px; float: left; width: 877.5px;\">\r\n<div class=\"single-well\" style=\"box-sizing: border-box; margin-top: 20px;\">\r\n<p style=\"box-sizing: border-box; margin: 0px; color: #666666;\">Your office building is the face of your company. That&rsquo;s why, using the latest technologies and procedures, we provide a clean, fresh environment in your project room, conference room etc. for you and your employees. Our custom package offers you a one year service which includes cleaning your commercial place once in every month and you have to pay monthly www.bdserve.com.bd 10 | Page after taking the service. To keep your organization, clean at its best, we provide services of the highest standards backed by our experts who understand your unique needs.</p>\r\n</div>\r\n</div>\r\n</div>', 1),
(2, 4, 'Residential Cleaning', '1648025929-70217066.jpg', 'We are committed to high standards of service, and we enforce stringent quality assurance', '<div class=\"row\" style=\"box-sizing: border-box; margin-left: -15px; margin-right: -15px; color: #444444; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">\r\n<div class=\"col-md-12 col-sm-12 col-xs-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-left: 15px; padding-right: 15px; float: left; width: 877.5px;\">\r\n<div class=\"single-well\" style=\"box-sizing: border-box; margin-top: 20px;\">\r\n<p style=\"box-sizing: border-box; margin: 0px; color: #666666;\">We are committed to high standards of service, and we enforce stringent quality assurance standards. We are insured and bonded, and we use environmentally responsible and sustainable cleaning products.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>', 1),
(3, 6, 'Pest Controlling', '1648025973-51672921.jpg', 'Pest control is very much needed for an organization. The principal objective of pest control', '<div class=\"row\" style=\"box-sizing: border-box; margin-left: -15px; margin-right: -15px; color: #444444; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">\r\n<div class=\"col-md-12 col-sm-12 col-xs-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-left: 15px; padding-right: 15px; float: left; width: 877.5px;\">\r\n<div class=\"single-well\" style=\"box-sizing: border-box; margin-top: 20px;\">\r\n<p style=\"box-sizing: border-box; margin: 0px; color: #666666;\">Pest control is very much needed for an organization. The principal objective of pest control is to protect important documents or assets of a property by maintaining the environment of the property. It is the procedure of minimizing or removing a broad array of unwelcomed insects and other pests. We are government certified and we use government authorized good quality chemicals and equipments. We will help you to make your property clean &amp; incredibly free from these unwanted insects.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>', 1),
(4, 6, 'Outdoor & Indoor Glass Cleaning', '1648026411-33471043.jpg', 'Window cleaning is the exterior cleaning of architectural glass used for structural, lighting or', '<div class=\"row\" style=\"box-sizing: border-box; margin-left: -15px; margin-right: -15px; color: #444444; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">\r\n<div class=\"col-md-12 col-sm-12 col-xs-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-left: 15px; padding-right: 15px; float: left; width: 877.5px;\">\r\n<div class=\"single-well\" style=\"box-sizing: border-box; margin-top: 20px;\">\r\n<p style=\"box-sizing: border-box; margin: 0px; color: #666666;\">Window cleaning is the exterior cleaning of architectural glass used for structural, lighting or decorative purposes. Windows help to increase a building&rsquo;s appearance. We provide both exterior and interior window cleaning services.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>', 1),
(5, 5, 'Deep Cleaning Service', '1648026462-40024538.jpg', 'Deep cleaning reaches the deep grime and dirt in your home. It is a comprehensive top to', '<div class=\"row\" style=\"box-sizing: border-box; margin-left: -15px; margin-right: -15px; color: #444444; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">\r\n<div class=\"col-md-12 col-sm-12 col-xs-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-left: 15px; padding-right: 15px; float: left; width: 877.5px;\">\r\n<div class=\"single-well\" style=\"box-sizing: border-box; margin-top: 20px;\">\r\n<p style=\"box-sizing: border-box; margin: 0px; color: #666666;\">Deep cleaning reaches the deep grime and dirt in your home. It is a comprehensive top to bottom cleaning of your commercial place. This in-depth cleaning will get your home &lsquo;super&rsquo; clean. Our deep cleaning service covers areas that are not traditionally covered by regular cleaning. All our services are government certified and highly recommended for first visit. A deep clean includes all the services of a standard clean but with more attention to areas you may have forgotten to clean up over time. We recommend a deep cleaning if you have not had your apartment professionally cleaned within the past three (3) months, or if you do www.bdserve.com.bd 11 | Page not use a cleaning service on a regular basis. Our deep cleaning professionals know exactly where to focus their efforts on, whether it is under your table or that corner that you haven&rsquo;t attempted to clean in months. We use special cleaner products for other surfaces and environments, including toilet cleaners, spot and stain remover sprays, degreasers and lime scale removers. Afterwards, our standard service will be more than enough to keep your organization in top shape.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>', 1),
(6, 6, 'AFTER RENOVATION', '1648026683-46701460.jpg', 'Aspernatur sit adipisci quaerat unde at neque Redug Lagre dolor sit amet consectetu.', '<div class=\"row\" style=\"box-sizing: border-box; margin-left: -15px; margin-right: -15px; color: #444444; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">\r\n<div class=\"col-md-12 col-sm-12 col-xs-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-left: 15px; padding-right: 15px; float: left; width: 877.5px;\">\r\n<div class=\"single-well\" style=\"box-sizing: border-box; margin-top: 20px;\">\r\n<p style=\"box-sizing: border-box; margin: 0px; color: #666666;\">When replacing a multi-lined selection of text, the generated dummy text maintains the amount of lines. When replacing a selection of text within a single line, the amount of words is roughly being maintained.When the replaced text selection consists fully of lower-cased or capital letters or begins with a capital letter, that previous casing is maintained. Furthermore, the presence or absence of a trailing punctuation mark of a replaced text selection is being maintained.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row mar-row\" style=\"box-sizing: border-box; margin-left: -15px; margin-right: -15px; margin-top: 40px; color: #444444; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">\r\n<div class=\"col-md-6 col-sm-12 col-xs-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-left: 15px; padding-right: 15px; float: left; width: 438.75px;\">\r\n<div class=\"single-page\" style=\"box-sizing: border-box; overflow: hidden;\">\r\n<div class=\"page-img elec-page\" style=\"box-sizing: border-box;\"><img style=\"box-sizing: border-box; border: 0px; vertical-align: middle; max-width: 100%; height: auto;\" src=\"file:///D:/Project/cleanhome/img/service/2.jpg\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 col-sm-12 col-xs-12\" style=\"box-sizing: border-box; position: relat