">Complete cleaning</h4>\r\n<p style=\"box-sizing: border-box; margin: 0px; color: #666666;\">When replacing a multi-lined selection of text, the generated dummy text maintains the amount of lines.</p>\r\n<ul class=\"marker-list\" style=\"box-sizing: border-box; margin: 0px; list-style: outside none none; padding: 0px;\">\r\n<li style=\"box-sizing: border-box; color: #666666; padding-left: 30px; margin: 10px 0px; position: relative; font-size: 16px;\">Words is roughly being maintained</li>\r\n<li style=\"box-sizing: border-box; color: #666666; padding-left: 30px; margin: 10px 0px; position: relative; font-size: 16px;\">Letters or begins with a capital letter</li>\r\n<li style=\"box-sizing: border-box; color: #666666; padding-left: 30px; margin: 10px 0px; position: relative; font-size: 16px;\">Previous casing is maintained</li>\r\n<li style=\"box-sizing: border-box; color: #666666; padding-left: 30px; margin: 10px 0px; position: relative; font-size: 16px;\">Maintains the amount of lines</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 col-sm-12 col-xs-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-left: 15px; padding-right: 15px; float: left; width: 438.75px;\">\r\n<div class=\"single-page\" style=\"box-sizing: border-box; overflow: hidden;\">\r\n<div class=\"page-img elec-page\" style=\"box-sizing: border-box;\"><img style=\"box-sizing: border-box; border: 0px; vertical-align: middle; max-width: 100%; height: auto;\" src=\"file:///D:/Project/cleanhome/img/service/3.jpg\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n</div>', 1),
(7, 5, 'Carpet Shampooing Service', '1648641239-31230784.jpg', 'Carpet is floor covering made from thick woven fabric. Since it is made from fabric, it usually', '<p style=\"text-align: justify;\">Carpet is floor covering made from thick woven fabric. Since it is made from fabric, it usually absorbs dust and gets dirty easily. We are the government certified company providing you the best carpet cleaning and maintaining service using the good quality chemicals. Our cleaning expert team will provide you best carpet cleaning experience. We use specialized tools, techniques and equipment to clean your carpets. We use Johnson Diversey Enhance Extraction Cleaner and Dry Foam carpet cleaner. They destroy unpleasant smells, removes large stains and marks, leaving fresh, apple fragrance. Our cleaning team is very expert, and our cleaning process is very effective in eliminating unhealthy and unwanted elements from your home and office.</p>', 1),
(8, 4, 'Office Boy, Messenger, Loader & Peon Service', '1648641316-90909228.jpg', 'We also provide Office Boy, Peon Services to many Multinational Companies, Government', '<p style=\"text-align: justify;\">We also provide Office Boy, Peon Services to many Multinational Companies, Government sectors or private firms. We have well trained, government authorized and hard worker peons, courier boys, secretaries, receptionists to handle your office work dedicatedly. We understand the exact needs and requirements of clients and try our best to provide effective performance. Our staffs are verified by local police and trained under expert professionals. So, contact us if you are looking for dependable &amp; trustable office boy services.</p>', 1),
(9, 4, 'On Demand Cleaning', '1648641463-31490844.jpg', 'We try to provide services according to our customers’ needs at the right time. We do not', '<p style=\"text-align: justify;\">We try to provide services according to our customers&rsquo; needs at the right time. We do not delay providing our services. If you need an immediate glass cleaning, floor cleaning, pest control service, deep cleaning or office boy service you can just call us, and we will respond www.bdserve.com.bd 12 | Page to you instantly. Our On Call Service team is always ready to serve you whenever you need us. We provide all the important services by getting one call. We value the importance of your organization. We also take pride in our affordable and unbeatable prices, which lets us help you to save your money and time. Whenever you need our services, we are just right there to help you.</p>', 0);
