(1, 'https://www.facebook.com/', 'https://www.twitter.com/', 'https://www.youtube.com/', 'https://www.facebook.com/', 'https://www.facebook.com/', 'https://www.linkedin.com/', '+880 1724152777', 'bdserve2020@gmail.com', '9:00 am - 7:00 pm', 'House # 12 (2nd Floor), Road # 03, Block- G, Rampura, Banasree, Dhaka-1219.', 'Greetings from Clean home', 'Dr. Ahmed is a renowned public health and management professional with a strong professional experiences in digital health services, strategic planning, program design, implementation, partnership & capacity building, resource mobilization and policy advocacy with Government, NGOs, private sectors. He is working over 30 years in national and international settings with international NGOs, UN Agencies, Government & private sector both in Bangladesh and international assignments with varieties of cross-cultural settings in South and Central Asia. He has provided leadership in health sector including maternal, child health & new-born health (MNCH), Sexual & Reproductive health, Family Planning, HIV/AIDS, Nutrition program & utilization of Digital Health services. He has proven experiences in implementing nationawide digital health services, program development, performance based framework, fund raising & working with Government health systems.', 'Copyright © 2022 VMSL All Rights Reserved', '1648117153-49151449.png', '1648114499-77248320.png');
